import React from 'react';
import Screen from './Screen/Screen';
import Keypad from './Keypad/Keypad';

class calculator extends React.Component {
    render() {
        return (
            <main className="calculator">
                <Screen />
                <Keypad />
            </main>
        );
    }
}

export default calculator;
